import React from 'react';


const WelcomePage = () => {

 return (
   <div>
     <h1 className="text-green-800 text-4xl">Welcome to the Keycloak</h1>
                   <button
                     type="button"
                     className="text-blue-800"
                     onClick={() => keycloak.login()}
                   >
                     Login
                   </button>
   </div>
 );
};

export default WelcomePage;
